import React, { useState } from "react";
import { useNavigate } from "react-router-dom";

export const LoginForm = ({ login }) => {
    const navigate = useNavigate();

    const form = {
        username: "",
        password: "",
    };

    const [signup, setSignup] = useState(form);

    const handleSubmit = async (e) => {
        e.preventDefault();
        login(signup.username, signup.password);
        navigate("/");
    };

    const handleChange = (e) => {
        const { name, value } = e.target;
        setSignup((prevState) => ({
            ...prevState,
            [name]: value,
        }));
    };

        return (
            <>
                <h1>Login</h1>
                <form onSubmit={handleSubmit}>
                    <label className="input input-bordered flex items-center gap-2" htmlFor="username">
                        <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 16 16" fill="currentColor" className="w-4 h-4 opacity-70">
                            <path d="M2.5 3A1.5 1.5 0 0 0 1 4.5v.793c.026.009.051.02.076.032L7.674 8.51c.206.1.446.1.652 0l6.598-3.185A.755.755 0 0 1 15 5.293V4.5A1.5 1.5 0 0 0 13.5 3h-11Z" />
                            <path d="M15 6.954 8.978 9.86a2.25 2.25 0 0 1-1.956 0L1 6.954V11.5A1.5 1.5 0 0 0 2.5 13h11a1.5 1.5 0 0 0 1.5-1.5V6.954Z" />
                        </svg>
                        <input
                            id="username"
                            name="username"
                            type="text"
                            onChange={handleChange}
                            value={signup.username}
                            autoComplete="username"
                            className="grow"
                            placeholder="Username"
                        />
                    </label>

                    <label className="input input-bordered flex items-center gap-2" htmlFor="password">
                        <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 16 16" fill="currentColor" className="w-4 h-4 opacity-70">
                            <path fillRule="evenodd" d="M14 6a4 4 0 0 1-4.899 3.899l-1.955 1.955a.5.5 0 0 1-.353.146H5v1.5a.5.5 0 0 1-.5.5h-2a.5.5 0 0 1-.5-.5v-2.293a.5.5 0 0 1 .146-.353l3.955-3.955A4 4 0 1 1 14 6Zm-4-2a.75.75 0 0 0 0 1.5.5.5 0 0 1 .5.5.75.75 0 0 0 1.5 0 2 2 0 0 0-2-2Z" clipRule="evenodd" />
                        </svg>
                        <input
                            id="password"
                            name="password"
                            type="password"
                            onChange={handleChange}
                            value={signup.password}
                            autoComplete="current-password"
                            className="grow"
                            placeholder="Password"
                        />
                    </label>

                    <br />
                    <button type="submit">Submit</button>
                </form>
            </>
        );
    };
